'use strict';

const Page = require("sf-core/ui/page");
const Application = require("sf-core/application");


/**
 * Abstract Renderer Strategy
 * It encapsulates displaying strategies for child views.
 * 
 * @access package
 * @abstract
 */
class Renderer {
  /**
   * Helper method sets statically rootController of the Application by DeviceOS
   * 
   * @static
   * @param {BottomTabBarController|Page|NavigationController} rootController
   */
  static setasRoot(rootController) {
    if (Device.deviceOS === "iOS") {
      var sfWindow = SF.requireClass("UIApplication").sharedApplication()
        .keyWindow;
      sfWindow.rootViewController = rootController.nativeObject;

      rootController.nativeObject.view.addFrameObserver();
      rootController.nativeObject.view.frameObserveHandler = e => {
        for (var child in rootController.nativeObject.childViewControllers) {
          rootController.nativeObject.childViewControllers[child].view.frame = {
            x: 0,
            y: 0,
            width: e.frame.width,
            height: e.frame.height
          };

          if (
            rootController.nativeObject.childViewControllers[child].view.yoga
              .isEnabled
          ) {
            rootController.nativeObject.childViewControllers[
              child
            ].view.yoga.applyLayoutPreservingOrigin(true);
          }
        }
      };
      // currentChild = controller;
    } else {
      Application.setRootController(rootController);
    }
  }

  makeRootVisible(){
    var sfWindow = SF.requireClass("UIApplication").sharedApplication()
        .keyWindow;
    sfWindow.makeKeyAndVisible();
  }

  /**
   * Only use if rootpage is Page instancea
   *
   * @protected
   * @param {Page} fromPage
   * @param {Page} toPage
   * @param {number} [duration=0] duration
   * @param {number} [options=0] options
   */
  showWithTransition(fromPage, toPage, duration = 0, options = 0) {
    throw new Error("onNavigatorChange method must be overridden");
  }

  /**
   * Template method sets specified controller as root controller
   * @param {BottomTabBarController|Page|NavigationController} controller
   */
  setRootController(controller) {
    this._rootController = controller;
  }

  /**
   * NavigationController child page is changed handler
   * Only use if rootpage is NavigationController.
   * Must be Implemented
   * 
   * @param {function(e:NavigationControllerTransformEvent)} fn
   */
  onNavigationControllerTransition(fn) {
    throw new Error("onNavigatorChange method must be overridden");
  }

  /**
   * Set TabBarItems to BottomTabBarController
   * 
   * @param {Array<TabBarItem>} items
   */
  setTabBarItems(items) {
    this._rootController.tabBar.items = items;
  }

  /**
   * Set NavigationController selected index
   * 
   * @param {nummer} index
   */
  setSelectedIndex(index) {
    this._rootController.selectedIndex = index;
    // this._rootController.hasOwnProperty('selectedIndex') ? (this._rootController.selectedIndex = index) : (this.setIndex(index));
  }

  /**
   * Set NavigationController child controllers.
   * Must be implemented.
   * 
   * @params {Array<NavigationController>} children
   */
  setChildControllers(children) {
    throw new Error("addChildViewControllers method must be overridden");
  }

  /**
   * Remove child from root page
   * Must be implemented.
   * 
   * @param {Page} page
   */
  removeChild(page) {
    throw new Error("removeChild must be overridden");
  }

  /**
   * Add child from root page
   * Must be implemented.
   * 
   * @param {Page} page
   */
  addChild(page) {
    throw new Error("addChild must be overridden");
  }

  /**
   * Push child from root NavigationController.
   * Must be implemented.
   * 
   * @param {Page} page
   * @param {boolean} [animated=true] animmated
   */
  pushChild(page, animated = true) {
    throw new Error("pushChild must be overridden");
  }

  /**
   * Pop child from root NavigationController.
   * Must be implemented.
   * 
   * @param {boolean} [animated=true] animmated
   */
  popChild(animated = true) {
    throw new Error("popChild must be overridden");
  }

  /**
   * Displays specified page
   * Only use if root conttroller is a Page instance
   *
   * @param {Page} page
   */
  show(page){
    throw new Error("popChild must be overridden");
  }
}

module.exports = Renderer;

const DeviceOS = require("../common/DeviceOS");

module.exports = function createRenderer(root, params = {}) {
  let Renderer;
  switch (Device.deviceOS) {
    case DeviceOS.ios:
      Renderer = require("./IOSRenderer");
      break;
    case DeviceOS.android:
      Renderer = require("./AndroidRenderer");
      break;
    default:
      throw new TypeError(Device.deviceOS + " Invalid OS definition.");
  }

  return new Renderer(root, params);
};

const TransitionOptions = require("./IOSTransitions");

/**
 * @ignore
 *
 */
class iOSAnimator {
  constructor(containerView) {
    this._containerView = containerView;
    this._options = 0 << 20;
  }

  onAnimate(fn) {
    this._onAnimate = fn;
    return this;
  }

  onFinish(fn) {
    this._onFinish = fn;
    return this;
  }

  start(from, to, duration = 0, params = {}) {
    // options && (this._options = this._options | options);
    // this.getTime();
    this._containerView.nativeObject.transitionFromToDurationOptionsAnimationsCompletion(
      from.nativeObject,
      to.nativeObject,
      duration,
      TransitionOptions.UIViewAnimationOptionTransitionNone,
      () => {
        this._onAnimate &&
          this._onAnimate(
            this._containerView,
            from,
            to,
            duration,
            this._options,
            params
          );
      },
      finished => {
        this._onFinish &&
          this._onFinish(
            finished,
            this._containerView,
            from,
            to,
            duration,
            this._options,
            params
          );
        this._once && this.dispose();
      }
    );
  }

  dispose() {
    this._containerView = null;
    this._onFinish = null;
    this._onAnimate = null;
    this._easingFn = null;
  }

  once(val) {
    this._once = val;
    return this;
  }
}

module.exports = iOSAnimator;

"use strict";

const matchPath = require("../common/matchPath").matchPath;
const mapComposer = require("../utils/map");

/**
 * Route's path ValueObject
 * For internal use
 * @access private
 * @class
 */
class RoutePath {
  /**
   * Factory method to create a new instance
   *
   * @param {string} path
   */
  static of(path) {
    return new RoutePath(path);
  }

  /**
   * @constructor
   * @param {string} path
   */
  constructor(path) {
    this._path = path;
  }

  /**
   * @return {string}
   */
  getPath() {
    return this._path;
  }

  /**
   * @returns {boolean}
   */
  isRoot() {
    return this._path === "/";
  }

  /**
   * @returns {Object}
   */
  toObject() {
    return {
      path: this._path,
      isRoot: this.isRoot
    };
  }

  /**
   * @returns {RoutePath}
   */
  clone() {
    return new RoutePath(this._path);
  }

  /**
   * @return {boelean}
   */
  hasPath() {
    return this._path !== null || this._path !== undefined || this._path !== "";
  }
}

/**
 * Route implementation
 * @class
 */
class Route {
  /**
   * Static helper method to create a new instance of Route
   * 
   * @static
   * @param {RouteParams} param
   * @return {Route}
   */
  static of({
    path = null,
    routes = [],
    build = null,
    exact = false,
    onBeforeMatch = null,
    onBeforePush = null,
    to = null
  }) {
    return new Route({
      path,
      routes,
      build,
      exact,
      onBeforeMatch,
      onBeforePush,
      to
    });
  }
  /**
   * @constructor
   * @param {RouteParams} param
   */
  constructor({
    path = null,
    to = null,
    routes = [],
    build = null,
    exact = false,
    onBeforeMatch = null,
    onBeforePush = null
  }) {
    this._exact = exact;
    this._strict = false;
    this._build = build;
    this._path = path instanceof RoutePath ? path : new RoutePath(path);
    this._routes = routes;
    this.map = mapComposer.call(this, this._routes);
    this._to = to;
    this._onBeforeMatch = onBeforeMatch;
    this._onBeforePush = onBeforePush;
  }

  /**
   * @return {Object}
   */
  toObject() {
    return {
      path: this._path.getPath(),
      routes: this._routes.map(route => route.toObject())
    };
  }

  /**
   * String presentation of the component
   *
   * @return {string}
   */
  toString() {
    return `[object ${this.constructor.name}, path: ${this.getUrlPath()}]`;
  }

  /**
   * Helper method to return excat path of the component
   *
   * @return {string}
   */
  get routePath() {
    return this.getRedirectto() || this.getUrlPath();
  }

  /**
   * Returns redirection path
   *
   * @return {string}
   */
  getRedirectto() {
    return this._to;
  }

  /**
   * Builds a route's view
   *
   * @param {RouteMatch} match
   * @param {RouteState} state
   * @param {Router} router
   * @param {Page} view
   */
  build(match, state, router, view) {
    return (this._build && this._build(match, state, router, view)) || null;
  }

  /**
   * Triggered before when an exact match happends.
   * If the onBeforeMatch eventhandler is set
   * and onBeforeMatch returns 'true' then match happends
   * or onBeforeMatch returns 'false' then match is blocked
   *
   * @param {RouteMatch} match
   * @return {boolean}
   */
  onPrematch(match) {
    return (this._onBeforeMatch && this._onBeforeMatch(match)) || true;
  }

  /**
   * Route has a path
   *
   * @returns {boolean}
   */
  hasPath() {
    return this._path.hasPath();
  }

  /**
   * Queries if specified url match to the route path
   * @param {string} url
   * @returns {Match}
   */
  matchPath(url) {
    this._match = matchPath(url, {
      path: this._path.getPath(),
      exact: this._exact,
      strict: this._strict
    });

    return this._match;
  }

  /**
   * Returns route path as string
   *
   * @returns {string}
   */
  getUrlPath() {
    return this._path.getPath();
  }

  /**
   * Clones route's path and returns
   *
   * @return {RoutePath}
   */
  getPath() {
    return this._path.clone();
  }

  /**
   * Clones new instance of the route
   *
   * @returns {Route}
   */
  clone() {
    return Route.of({
      path: this._path,
      routes: this._routes.slice(),
      props: Object.assign({}, this._props),
      build: this._build,
      exact: this._exact,
      strict: this._strict
    });
  }
}

module.exports = Route;

"use strict";

const Route = require("./Route");
const matchRoutes = require("../common/matchRoutes");
const createHistory = require("../common/createHistory");
let actions = [];

let _historyController;

let _skipRender = false;

/**
 * Router Base
 * Base Router implementation
 *
 * @class
 * @extends {Route}
 */
class Router extends Route {
  /**
   * @constructor
   * @param {{ path: string, routes: Array, exact: boolean, isRoot: boolean, to: (string|null) }} param
   */
  constructor({
    path = "",
    build = null,
    routes = [],
    exact = false,
    isRoot = false,
    to = null,
    _historyController = null
  }) {
    super({ path, build, routes, to });
    // console.log("Router created");
    if (!_historyController) {
      // console.log("Router history is creating");
      _historyController = createHistory({
        getUserConfirmation: (blockerFn, callback) => {
          return blockerFn(callback);
        }
      });
      this._historyController = _historyController;
    }

    routes.forEach(route => {
      if (route instanceof Router) {
        route.initialize(this._historyController);
      }
    });

    this._historyUnlisten = () => null;
    if (isRoot) {
      this._historyUnlisten = this._historyController.listen(
        (location, action) => {
          console.log(`History is changed ${location.pathname}`);
          try {
            if (!_skipRender) {
              this.onHistoryChange(location, action);
            }
          } catch (e) {
            throw e;
          } finally {
            _skipRender = false;
          }
        }
      );
    }

    this._isRoot = isRoot;
    this._exact = exact;
    // this._cache = new WeakMap();
    this._unblock = () => null;
  }

  /**
   * @ignore
   * @private
   * @param {*} parentHistory
   */
  initialize(parentHistory) {
    this._historyController = parentHistory.createNode({
      getUserConfirmation: (blockerFn, callback) => {
        return blockerFn(callback);
      }
    });
  }

  /**
   * Adds specified eventlistener to handle history changes
   *
   * @param {HistoryListener} fn
   */
  listen(fn) {
    return this._historyController.listen(fn);
  }

  /**
   * Returns History
   *
   * @deprecated
   * @protected
   * @return {Object}
   */
  getHistory() {
    return this._historyController.history;
  }

  /**
   * Adds route block handler to history. When history is changed in anywhere
   * then the handler intercepts before history is changed.
   *
   * @param {RouterBlockHandler} fn
   */
  addRouteBlocker(fn) {
    const unblock = this._historyController.history.block(
      (location, action) => callback => {
        fn(location, action, callback);
      }
    );

    return unblock;
  }

  /**
   * Triggered when the current route's parent is another router.
   *
   * @protected
   * @param {string} action
   */
  onRouteExit(action) {}

  /**
   * @listens
   * @protected
   * @param {RouteLocation} location
   * @param {Object} action
   */
  onHistoryChange(location, action) {
    this._matches = matchRoutes([this].concat(this._routes), location.pathname);

    this.renderMatches(this._matches, location.state, action);
  }

  /**
   * Removes last entry from history.
   *
   * @protected
   */
  routeRollback() {
    this._historyController.rollback();
  }

  /**
   * Renders route matches by requested path
   *
   * @protected
   * @param {Array<{isExact: boolean,params: object,path: string,url: string}>} matches
   * @param {RouteState} state
   * @param {string} action
   */
  renderMatches(matches, state, action) {
    matches.some(({ match, route }, index) => {
      if (route !== this && route instanceof Router) {
        console.log("not exact match : " + this);
        // if(index > 0 && this._isRoot)
        this.addChildRouter &&
          actions.push([this.addChildRouter.bind(this), route]);
        // move routes to child router
        route.renderMatches(
          matches.slice(index, matches.length),
          state,
          action
        );

        return true;
      } else if (match.isExact === true) {
        console.log("exact match : " + route + " : " + route.getRedirectto());
        // route has redirection
        if (route.getRedirectto()) {
          console.log("redirection  : " + route.getRedirectto());
          actions = [];
          return this.redirectRoute(route, state, action);
        }

        if (this.onRouteMatch(route, match, state, action)) {
          actions.forEach(item => item[0](item[1]));
        }

        this.onRouterEnter && this.onRouterEnter(action);
        actions = [];

        return true;
      }
    });
  }

  /**
   * Handles if Router is activate router
   *
   * @protected
   * @param {?string} [action=null] action
   */
  onRouterEnter(action = null) {
    this.setasActiveRouter(action);
  }

  /**
   * Sets the router statically as active router
   *
   * @protected
   * @param {string} action
   */
  setasActiveRouter(action) {
    Router.currentRouter &&
      this != Router.currentRouter &&
      Router.currentRouter.onRouterExit &&
      Router.currentRouter.onRouterExit(action);
    Router.currentRouter = this;
  }

  /**
   * Redirects route and removes last route record from history
   *
   * @protected
   * @param {Route} route
   * @param {RouteState} state
   * @param {string} action
   */
  redirectRoute(route, state, action) {
    // redirection of a route
    this.routeRollback(); // remove last route from history
    this.push(route.getRedirectto(), state.routeState.data); // and add new route
  }

  /**
   * @ignore
   * @param {*} view
   */
  shouldRouteMatch(view) {
    return view !== null || view !== undefined;
  }

  /**
   * Route is matched event handler
   *
   * @protected
   * @param {Route} route
   * @param {RouteMatch} match
   * @param {RouteState} state
   * @param {string} action
   * @return {(object | null)}
   */
  onRouteMatch(route, match, state, action) {
    const view = this.renderRoute(route, match, state);

    if (!this.shouldRouteMatch(view)) {
      this.routeRollback();

      return null;
    }

    return view;
  }

  /**
   * Render route
   *
   * @protected
   * @param {Route} route
   * @param {RouteMatch} match
   * @param {RouteState} state
   */
  renderRoute(route, match, state) {
    let view = route.build(match, state.routeState || {}, this, state.view);
    state.view = view;

    return view;
  }

  /**
   * Helper method that pushes the route's url to history
   *
   * @protected
   * @param {Route} route
   */
  pushRoute(route) {
    this.push(route.getUrlPath());
  }

  /**
   * Change history by specified path
   *
   * @param {object|string} path - Path or matches of the route
   * @param {!object} [data={}] data
   * @return {Router}
   */
  push(path, data = {}) {
    // this._cache.get(path) ||
    console.log(`Push router ${path} ${this._historyController}`);
    if (path.charAt(0) !== "/") {
      path = this._path.getPath() + "/" + path;
    }

    this._historyController.push(path, { routeState: { data } });

    return this;
  }

  /**
   * Replaces specified path's state
   *
   * @param {string} path
   * @param {data} data
   */
  replace(path, data) {
    this._historyController.history.replace(path, { routeState: { data } });
  }

  /**
   * Rewinds history
   * @fires
   */
  goBack() {
    this._historyController.goBack();
  }

  /**
   * Returns last location of history
   *
   * @return {RouteLocation}
   */
  getLocation() {
    return this._historyController.history.location;
  }

  /**
   * Returns History entries as Array
   * @return {Array<string>}
   */
  getHistoryasArray() {
    return this._historyController.history.entries.map(item => item.pathname);
  }

  /**
   * Forwards history
   */
  goForward() {
    this._historyController.history.goForward();
  }

  /**
   * Changes route by history index.
   *
   * @experimental
   * @param {number} index
   * @return {boolean}
   */
  go(index) {
    if (this.getHistory().canGo(index)) {
      this.getHistory().index();
      return true;
    }

    return false;
  }

  /**
   * Adds new route
   *
   * @param {Route} route
   */
  add(route) {
    this._routes.push(route);
  }

  /**
   * Iterates child routes
   *
   * @paramms {function} fn
   * @return {Array}
   */
  map(fn) {
    return this._routes.map(fn);
  }

  /**
   * Unloads the router
   */
  dispose() {
    this._historyUnlisten();
    // if (this._isRoot) {
    this._historyController.dispose();
    this._historyController = null;
    // }
    this._routes.forEach(route => route.dispose());
    this._routes = null;
    this._historyUnlisten = null;
    this._unblock && this._unblock();
    this._unblock = null;
  }
}

module.exports = Router;

/**
 * @ignore
 *
 */
module.exports = function mapComposer(arr) {
  return fn => arr.map(fn);
};

# Smartface Router

[Read Documentation](https://smartface.github.io/router/)

## Installation

```
cd ~/workspace/scripts && npm i @smartface/router
```

## Usage

```javascript
const Router = require("@smartface/router/src/native/NativeRouter");
const RouterBase = require("@smartface/router/src/router/Router");
const StackRouter = require("@smartface/router/src/native/NativeStackRouter");
const BottomTabBarRouter = require("@smartface/router/src/native/BottomTabBarRouter");
const Route = require("@smartface/router/src/router/Route");
const Color = require("sf-core/ui/color");
const Image = require("sf-core/ui/image");

var tabbar1 = Image.createFromFile("images://tabbar1.png");

const router = Router.of({
  path: "/",
  to: "/pages/page1",
  isRoot: true,
  routes: [
    BottomTabBarRouter.of({
      path: "/pages",
      tabbarParams: () => ({
        ios: { translucent: false },
        itemColor: Color.RED,
        unselectedItemColor: Color.YELLOW,
        backgroundColor: Color.BLUE,
        height: 100
      }),
      items: () => [{ title: "Page1" }, { title: "Page2", icon: tabbar1 }],
      routes: [
        Route.of({
          path: "/pages/page1",
          build: (match, state, router) => {
            let Page1 = require("pages/page1");
            return new Page1(router);
          }
        }),
        Route.of({
          path: "/pages/page2",
          build: (match, state, router, view) => {
            // if (view) {
            //     view.routeData = state.data;
            //     return view;
            // }

            let Page2 = require("pages/page2");
            return new Page2({}, router);
          }
        })
      ]
    }),
    StackRouter.of({
      path: "/user",
      routes: [
        Route.of({
          path: "/user/login",
          build: (match, state, router, view) => {
            // if checked is false
            if (state.data.checked) {
              // then blocks route
              return null;
            }
            let Page2 = require("pages/page2");
            return new Page2({ message: "user login page" }, router);
          }
        })
      ]
    })
  ]
});

router.push("/pages/page1");
```

## Blocking Routes

### Limitation

It doesn't work with iOS default headerbar's back-button and back gesture. If you want to use in these cases, you must use custom back button and disable back gesture.

```js
router.addRouteBlocker((location, action, callback) => {
  alert({
    message: "Would you like to answer?",
    title: "Question", //optional
    buttons: [
      {
        text: "Yes",
        type: AlertView.Android.ButtonType.POSITIVE,
        onClick: function() {
          callback(true);
        }
      },
      {
        text: "No",
        type: AlertView.Android.ButtonType.NEGATIVE,
        onClick: function() {
          callback(false);
        }
      }
    ]
  });
});
```

## Listening history changes

```js
const unlisten = router.getHistory().listen((location, action) => {
  console.log(`new route action :  ${action} path : ${location.pathname}`);
});

unlisten();
```

