                return { type: "target1" };
              }
            }),
            new Route({
              path: "/path/too/:name",
              build: (params, state, router) => {
                component.router = router;
                return component;
              }
            }),
            new Route({ path: "*", build: { type: "target3" } })
          ]
        })
      ]
    });

    router.push("/path/to/1", { name: "name" });
    router.push("/path/too/dev", { name: "name" });
    component.router.goBack();

    expect(data).toEqual({
      params: { name: "1" },
      state: { data: { name: "name" } }
    });

    expect(component.router === router).toBe(false);
    expect(callCount).toBe(2);
  });

  it("calls back to parent if its history is empty", () => {
    let data;
    let callCount = 0;
    var component = {};

    const router = new Router({
      path: "/",
      isRoot: true,
      routes: [
        new Route({
          path: "/path2/to/:name",
          build: (match, state, router) => {
            data = {
              params: match.params,
              state
            };
            // component.router = router;
            callCount++;
            return { type: "target1" };
          }
        }),
        new Router({
          path: "/path",
          routes: [
            new Route({
              path: "/path/to/:name",
              build: (params, state, router) => {
                callCount++;
                component.router = router;
                return component;
              }
            }),
            new Route({ path: "*", build: { type: "target3" } })
          ]
        })
      ]
    });

    router.push("/path2/to/1", { name: "name" });
    router.push("/path/to/dev", { name: "name" });
    component.router.goBack();

    expect(data).toEqual({
      params: { name: "1" },
      state: { data: { name: "name" } }
    });
    expect(callCount).toBe(3);
  });
  it("can call a relative path", () => {
    let data;
    let callCount = 0;
    var component1 = {};
    var component2 = {};

    const router = new Router({
      path: "/",
      isRoot: true,
      routes: [
        new Route({
          path: "/path2/to/:name",
          build: (match, state, router) => {
            data = {
              params: match.params,
              state
            };
            // component.router = router;
            callCount++;
            return { type: "target1" };
          }
        }),
        new Router({
          path: "/path",
          routes: [
            new Route({
              path: "/path/to/:name([a-zA-Z]*)",
              build: (match, state, router) => {
                component1.router = router;
                component1.params = match.params;
                return component1;
              }
            }),
            new Route({
              path: "/path/to/:id",
              build: (match, state, router, view) => {
                component2.router = router;
                component2.params = match.params;
                return component2;
              }
            })
          ]
        })
      ]
    });

    router.listen((location, action) => {
      console.log(location);
    });

    router.push("/path/to/cenk", { name: "name" });
    component1.router.push("/path/to/1123", { name: "name" });

    // expect(component1.router === router).toBe(false);
    // expect(component1.params.name).toBe("cenk");
    expect(component2.params.id).toBe("1123");
    expect(router.getHistory().entries.map(entry => entry.pathname)).toEqual([
      "/path/to/cenk"
    ]);
  });

  it("can be blocked", () => {
    let callCount = 0;
    var component1 = {};
    const router = new Router({
      path: "/",
      isRoot: true,
      routes: [
        new Route({
          path: "/path/to/:name([a-zA-Z]*)",
          build: (match, state, router) => {
            component1.router = router;
            component1.params = match.params;
            return component1;
          }
        }),
        new Route({
          path: "/path/to/:id",
          build: (match, state, router, view) => {
            return component1;
          }
        })
      ]
    });

    router.addRouteBlocker((location, action, callback) => {
      callback(false);
    });

    router.push("/path/to/cenk", { name: "name" });
    expect(router.getHistory().entries).toEqual([]);

    router.push("/path/to/cenk", { name: "name" });
    router.addRouteBlocker((location, action, callback) => {
      callback(true);
    });

    expect(router.getHistory().entries[0].pathname).toBe("/path/to/cenk");
  });

  it("can redirect to specified route when route has 'to' attribute", () => {
    let callCount = 0;
    var component1 = {};
    const router = new Router({
      path: "/",
      isRoot: true,
      routes: [
        new Route({
          path: "/path",
          to: "/path/to/1",
          build: (match, state, router) => {
            component1.router = router;
            component1.params = match.params;
            return component1;
          }
        }),
        new Route({
          path: "/path/to/:id",
          build: (match, state, router, view) => {
            return component1;
          }
        })
      ]
    });

    router.push("/path", { name: "name" });
    console.log(`entries`, router.getHistory().entries[1]);
    expect(router.getHistory().entries[0].pathname).toBe("/path/to/1");
    expect(router.getHistory().entries[0].state).toEqual({
      routeState: { data: { name: "name" } }
    });
  });
});

const Route = require("../src/router/Route");
const matchRoutes = require("../src/common/matchRoutes");

describe("Match Routes", () => {
  it("can match with param", () => {
    const routes = [
      new Route({
        path: "/new-path",
        routes: [new Route({ path: "/new-path/:name" })]
      })
    ];

    const matches = matchRoutes(routes, "/new-path/cenkce").map(
      ({ match, route }) => ({ match, route: route.toObject() })
    );

    expect(matches).toEqual([
      {
        match: {
          isExact: false,
          params: {},
          path: "/new-path",
          url: "/new-path"
        },
        route: {
          path: "/new-path",
          routes: [{ path: "/new-path/:name", routes: [] }]
        }
      },
      {
        match: {
          isExact: true,
          params: { name: "cenkce" },
          path: "/new-path/:name",
          url: "/new-path/cenkce"
        },
        route: { path: "/new-path/:name", routes: [] }
      }
    ]);
  });
  it("gets routes if parameter is just numeric", () => {
    const routes = [
      new Route({
        path: "/new-path",
        routes: [new Route({ path: "/new-path/:id(\\d+)" })]
      })
    ];

    {
      const matches = matchRoutes(routes, "/new-path/cenkce").map(
        ({ match, route }) => ({ match, route: route.toObject() })
      );

      expect(matches).toEqual([
        {
          match: {
            isExact: false,
            params: {},
            path: "/new-path",
            url: "/new-path"
          },
          route: {
            path: "/new-path",
            routes: [{ path: "/new-path/:id(\\d+)", routes: [] }]
          }
        }
      ]);
    }
    {
      const matches = matchRoutes(routes, "/new-path/123").map(
        ({ match, route }) => ({ match, route: route.toObject() })
      );
      expect(matches).toEqual([
        {
          match: {
            isExact: false,
            params: {},
            path: "/new-path",
            url: "/new-path"
          },
          route: {
            path: "/new-path",
            routes: [{ path: "/new-path/:id(\\d+)", routes: [] }]
          }
        },
        {
          match: {
            isExact: true,
            params: { id: "123" },
            path: "/new-path/:id(\\d+)",
            url: "/new-path/123"
          },
          route: { path: "/new-path/:id(\\d+)", routes: [] }
        }
      ]);
    }
  });
  it("mathes routes if parameter is alphanumeric", () => {
    const routes = [
      new Route({
        path: "/new-path",
        routes: [new Route({ path: "/new-path/:name([A-Za-z0-9]*)" })]
      })
    ];

    {
      const matches = matchRoutes(routes, "/new-path/cenkce").map(
        ({ match, route }) => ({ match, route: route.toObject() })
      );

      [
        {
          match: {
            path: "/new-path",
            url: "/new-path",
            isExact: false,
            params: {}
          },
          route: {
            path: "/new-path",
            routes: [
              {
                path: null,
                routes: []
              }
            ]
          }
        }
      ];
      expect(matches).toEqual([
        {
          match: {
            isExact: false,
            params: {},
            path: "/new-path",
            url: "/new-path"
          },
          route: {
            path: "/new-path",
            routes: [{ path: "/new-path/:name([A-Za-z0-9]*)", routes: [] }]
          }
        },
        {
          match: {
            isExact: true,
            params: { name: "cenkce" },
            path: "/new-path/:name([A-Za-z0-9]*)",
            url: "/new-path/cenkce"
          },
          route: { path: "/new-path/:name([A-Za-z0-9]*)", routes: [] }
        }
      ]);
    }
    {
      const matches = matchRoutes(routes, "/new-path/abc123").map(
        ({ match, route }) => ({ match, route: route.toObject() })
      );
      expect(matches).toEqual([
        {
          match: {
            isExact: false,
            params: {},
            path: "/new-path",
            url: "/new-path"
          },
          route: {
            path: "/new-path",
            routes: [{ path: "/new-path/:name([A-Za-z0-9]*)", routes: [] }]
          }
        },
        {
          match: {
            isExact: true,
            params: { name: "abc123" },
            path: "/new-path/:name([A-Za-z0-9]*)",
            url: "/new-path/abc123"
          },
          route: { path: "/new-path/:name([A-Za-z0-9]*)", routes: [] }
        }
      ]);
    }
  });
});
